DROP TABLE board_t;
CREATE TABLE board_t (
  board_no  NUMBER              NOT NULL,
  title     VARCHAR2(4000 BYTE) NOT NULL,
  contents  CLOB,
  create_dt DATE,
  modify_dt DATE,
  CONSTRAINT pk_board PRIMARY KEY(board_no)
);

DROP SEQUENCE board_seq;
CREATE SEQUENCE board_seq START WITH 1001;

